//USER PANELS
import UserDashBoard from './userPanels/userDashBoard';
import ContactUs from './userPanels/contactUs';
import PerchWallet from './userPanels/perchWallet';
import Settings from './userPanels/settings';
import TripHistory from './userPanels/tripHistory';

//DRIVER PANELS
import DriverDashBoard from './driverPanels/driverDashBoard';
import DriverTripHistory from './driverPanels/driverTripHistory';
import DriverVehicles from './driverPanels/driverVehicles';
import HelpAndFAQ from './driverPanels/helpAndFAQ';

//DRIVER APPLICATION PANELS
import VehicleConfirmation from './driverApplicationPanels/vehicleConfirmation';
import ApplicationStatus from './driverApplicationPanels/applicationStatus';
import UploadDocuments from './driverApplicationPanels/uploadDocuments';

//ADMIN PANELS
import AdminDashBoard from './adminPanels/adminDashBoard';
import CancelledTrips from './adminPanels/cancelledTrips';
import DriverApplications from './adminPanels/driverApplications';
import ListOfDrivers from './adminPanels/listOfDrivers';
import ListOfRiders from './adminPanels/listOfRiders';
import Payments from './adminPanels/payments';
import SendAnEmail from './adminPanels/sendAnEmail';
import UnreadMessages from './adminPanels/unreadMessages';
import VehicleApplications from './adminPanels/vehicleApplications';

export {

    //USER PANELS
    UserDashBoard,
    TripHistory,
    PerchWallet,
    ContactUs,
    Settings,

    //DRIVER PANELS
    DriverDashBoard,
    DriverVehicles,
    DriverTripHistory,
    HelpAndFAQ,

    //DRIVER APPLICATION PANELS
    VehicleConfirmation,
    UploadDocuments,
    ApplicationStatus,

    //ADMIN PANELS
    AdminDashBoard,
    SendAnEmail,
    CancelledTrips,
    UnreadMessages,
    VehicleApplications,
    DriverApplications,
    Payments,
    ListOfRiders,
    ListOfDrivers,
};
